import Link from 'next/link';
import Sandboxes from '../Frontend/app';

export default function Index() {
  return (
    <div>
      <Link href="/">
        <a className="ml-3" title="Last Page">
          Last Page
        </a>
      </Link>
      <Link href="/about">
        <a title="About Page">About Page</a>
      </Link>
      <Link href="/last">
        <a className="ml-3" title="Last Page">
          Last Page
        </a>
      </Link>
      <p>This is the first Next.js Page</p>
      <Sandboxes />
    </div>
  );
}
